description:
Girls Kissing Girls Vol 16 
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Welcome to the 16th installment of this critically acclaimed series. In this latest volume, nerdy Penny Pax gets revenge after spoiled brat August Ames bullies her for the last time. Both girls end up wrestling in the pool...controversial writer India Summer gets a lecture from publicist Sovereign Syre after India's latest op-ed piece crosses the line...cross country coach Cherie DeVille must persuade her star runner Ashlyn Molloy to stay on the team...popular artist Dani Daniels finds out girlfriend Dana Vespoli has been cheating. Dana begs Dani for one last passionate kiss...

Cast: August Ames, Penny Pax, Dani Daniels, India Summer, Dana Vespoli, Cherie DeVille, Ashlyn Molloy, Sovereign Syre, Dana Vespoli,Director

